import { PDFViewer } from '@react-pdf/renderer';

function pdf({profile}) {
useEffect(() => {
    console.log(profile)
})
return (
    <PDFViewer>
        <Document file={`/data/${profile}/${profile}.pdf`}/>
    </PDFViewer>
  );
};

export default PDFViewer;
